Torta con base di streusel ricomposto al cioccolato e caramello, inserto di cremoso agli arachidi, al centro di due strati di banana bread, il tutto avvolto in una mousse di panna cotta. Glassata con glassa a specchio nera con disco di banane sopra e alla base granella di arachidi a girare.
E voi? Che torta avete realizzato utilizzando le Fruttarine? Taggatemi nelle stories per farmi vedere le vostre ricette. 😁😁 Scoprite Fruttarine alla banana nelle Instagram Stories! 
